// -------------------- Import --------------------
import Axios from "axios";
import React from "react";

// -------------------- Row Favorites Table --------------------
export default function RowFavoritesTable(props) {
  console.log(props.item);
  return (
    <li>
      {props.item.PLAYER_ID?<img
            src={`https://cdn.nba.com/headshots/nba/latest/260x190/${props.item.PLAYER_ID}.png`}
            alt=""
          />:<img
          src={`https://cdn.nba.com/logos/nba/${props.item.TEAM_ID}/primary/L/logo.svg`}
          alt=""
        />}
      <p>{props.item.PLAYER_NAME || props.item.TEAM_CITY}</p>
      <p>{props.item.PTS || props.item.FT_PCT || props.item.FG3_PCT}</p>
      <button onClick={() => props.deleteItem(props.item._id)}>remove</button>
    </li>
  );
}
